import React, { useState } from "react";
import Images from "./Img";

const Search = () => {
    let [img, setImg] = useState('');

    let inputText = (e) => {
        let val = e.target.value;
        setImg(val)
    }


    return (
        <>
            <input placeholder="Search" value={img} onChange={inputText} />
            <Images name={img}/>
        </>
    )
}

export default Search;
